import * as React from 'react';

export default class Footer extends React.Component {
  public render() {
    return (
      <div className='footer'>
          <hr className='upper-line' />
          <p className="message">
              Just sharing anythings you catch in your life.
          </p>
          <hr />
      </div>
    );
  }
}
